import "./list.css";
import axios from "axios";
import { useState } from "react";

function List() {
  const addProduct = () => {
    const [list, setList] = useState();
    axios.get("http://localhost:4200/list/").then((res) => {
      setList(res.data), console.log(res.data);
    });
  };

  return (
    <div className="list">
      {list.map((list) => (
        <div>
          {list.id}
          {list.name}
        </div>
      ))}
    </div>
  );
}

export default List;
